class Solution {
    public String[][] merge(String[][] intervals) {
        if (intervals.length == 0 || intervals[0].length == 0) return new String[0][];
        Arrays.sort(intervals, (a, b) -> a[0].compareTo(b[0]));
        List<String[]> res = new ArrayList<>();
