            res.add(new String[]{intervals[i][0], intervals[i][1]});
            i = j - 1;
        }
        res.add(new String[]{intervals[intervals.length - 1][0], intervals[intervals.length - 1][1]});
        return res.toArray(new String[res.size()][]);
